    const [max_power, setMaxPower] = useState(dataItem?.max_power || '');
    const [socket_count, setsocketCount] = useState(dataItem?.socket_count || '');
    const [errorMessage, setErrorMessage] = useState('');

    const addManageDevice = async (e) => {
        alert(  JSON.stringify({ charger_id, tag_id, model, type, vendor, gun_connector, max_current, max_power, socket_count, modified_by: userInfo.email  }), 'add charger all data' );
        e.preventDefault();
        try {
            const max_currents = parseInt(max_current);
            const max_powers = parseInt(max_power);
            const socket_counts = parseInt(socket_count);
            const response = await fetch('superadmin/UpdateCharger', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ charger_id, tag_id, model, type, vendor, gun_connector, max_current:max_currents, max_power:max_powers, socket_count:socket_counts, modified_by: userInfo.email }),
            });
            alert(  JSON.stringify({ charger_id, tag_id, model, type, vendor, gun_connector, max_currents, max_powers, socket_counts, modified_by: userInfo.email }), 'add charger all data' );
            if (response.ok) {
                alert('Charger added successfully');
                backManageDevice();
            } else {
                setErrorMessage('Failed to Update');
            }
        }catch (error) {
                setErrorMessage('An error occurred while adding the charger');
                console.error('Error:', error);
        }
    };
    // Add Chargers end
    return (
        <div className='container-scroller'>
