                                                                        <input type="text" class="form-control" placeholder="Tag ID" value={tag_id}  onChange={(e) => setTagID(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Model</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Model" value={model}  onChange={(e) => setModel(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Type</label>
