                                                                        <input type="text" class="form-control" placeholder="Max Current" value={max_current}  onChange={(e) => setMaxCurrent(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Max Power</label>
